CREATE TABLE "public"."datasets" ("id" serial NOT NULL, "simulator_id" integer, "real_dataset_id" integer, "result" jsonb, PRIMARY KEY ("id") , FOREIGN KEY ("simulator_id") REFERENCES "public"."simulators"("id") ON UPDATE no action ON DELETE no action, FOREIGN KEY ("real_dataset_id") REFERENCES "public"."real_datasets"("id") ON UPDATE no action ON DELETE no action, UNIQUE ("id"));
